import React from "react";
import "../TrackerPage/TrackerPage.scss";
import returnButton from "../../assets/images/back-60.png";
import infoIcon from "../../assets/images/info.svg";
import Calendar from "../../components/Calendar/Calendar";

export default function TrackerPage() {
  return (
    <>
      <section className="progress">
        <div className="progress__banner">
          <h2 className="progress__title">Start Tracking Daily!</h2>

          <p>
            For every day you manage to complete your habit, track it down on
            our integrated calendar. You can also write down specific notes or
            reminders by clicking on the preset bar displayed.
          </p>
        </div>
        <div className="progress__calendar">
          <Calendar />
        </div>
      </section>
    </>
  );
}
